function Home() {
    const token = localStorage.getItem('token');

    return (
      <div>
        <h2>Home</h2>
        {token ? (
          <p>You are logged in! Your token: {token}</p>
        ) : (
          <p>You are not logged in.</p>
        )}
      </div>
    );
  }

  export default Home;
